INSERT INTO `adminnotification_inbox` VALUES (1,1,'2016-05-18 16:43:59','Community Edition 2.0.6 Provides Important Security and Functional Updates – 5/18/2016','Magento Community Edition 2.0.6 is now available and contains important security and functional improvements. More information on the security updates can be found on the Magento Security Center at https://magento.com/security/patches/magento-206-security-update. More information on the functional enhancements is provided in the release notes: http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.6CE.html','https://magento.com/security/patches/magento-206-security-update',0,0),(2,4,'2016-05-22 18:41:58','Repo.magento.com is currently unavailable. We are working to resolve this issue as quickly as possible – 5/22/16, 11:40 am PT','Users currently cannot access Magento 2 code updates from Repo.magento.com. We are investigating the issue and will update you when it is resolved. As an alternative, you can still access Magento 2 code from GitHub (https://github.com/magento/magento2) or from the Community Edition download page (https://www.magentocommerce.com/download). ','https://github.com/magento/magento2',0,0),(3,4,'2016-05-22 23:12:08','Issue with repo.magento.com has been resolved - 5/22/16, 4 pm PT','The issue with repo.magento.com has been resolved. You should be able to access Magento 2 code updates at this time.','http://devdocs.magento.com/guides/v2.0/install-gde/prereq/integrator_install.html',0,0),(4,4,'2016-05-24 14:08:30','New release: Magento Community Edition 2.0.7 Resolves Payment Gateway Issues – 5/24/16 ','Magento Community Edition 2.0.7 is now available. It resolves payment gateway issues experienced when using PHP 7.0.3. Review the release notes for more information: http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.7CE.html.','http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.7CE.html',0,0),(5,4,'2016-06-06 21:44:09','New Community Edition 2.0.7 Patch (MDVA-449) for Merchants Using PHP 5.5.x – June 6, 2016 ','A new patch, MDVA-449, enables merchants using Community Edition 2.0.7 and PHP 5.5.x to upgrade to future releases. It corrects a line of code in the Setup application that is packaged with Community Edition 2.0.7 that is not compatible with PHP 5.5.x. Merchants using Community Edition 2.0.7 with PHP 5.6.x and 7.0.x DO NOT need this patch. Learn more at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_207-upgrade.html ','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_207-upgrade.html ',0,0),(6,4,'2016-06-22 22:29:31','New Community Edition 2.0.x Patch (MDVA-532) Enables Upgrades to Magento 2.1 – June 22, 2016','A new patch, MDVA-532, enables merchants using Magento Community Edition 2.0.x to upgrade to Magento 2.1 Community Edition Release Candidates or GA software. More information about the patch and important instructions for command-line upgrades to Magento 2.1 when sample data is installed are available in a technical bulletin posted at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_21-upgrade.html.','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_21-upgrade.html',1,0),(7,4,'2016-06-23 16:44:46','Increase your sales and productivity, while simplifying PCI compliance with exciting new Magento Community Edition 2.1 features.','Shoppers can now check out faster using credit cards stored with PayPal and a redesigned PayPal checkout. PCI compliance is easier thanks to Braintree Hosted Fields. Admin tools are redesigned to help you work more efficiently. Upgrade to Enterprise Edition for new Content Staging and Preview and Enhanced Site Search capabilities.','https://magento.com/blog/magento-news/magento-enterprise-edition-21-unleashes-power-marketers-and-merchandisers ',1,0),(8,4,'2016-07-22 18:56:40','Community Edition 2.0.8 improves installation, configurable product creation and more – 7/19/2016','Magento Community Edition 2.0.8 makes several functional improvements that address issues with application installation, duplication of url keys during configurable product creation, and other issues described in the release notes posted at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.8CE.html.','http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.8CE.html',1,0),(9,4,'2016-08-10 22:27:44','Community Edition 2.0.9 Improves Performance and Product Quality ','Community Edition 2.0.9 is now available and improves storefront performance when a large number of configurable product variations are used and resolves issues with price and tax calculations, mini-cart displays and more. You can learn more in the release notes at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.9CE.html ','http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.9CE.html',0,0),(10,4,'2016-08-30 16:36:54','Community Edition 2.1.1 Features Performance and Functional Improvements – 8/30/2016','Community Edition 2.1.1 improves storefront performance when using many configurable product variations and addresses upgrade and installation issues. You can learn more in the release notes at http://devdocs.magento.com/guides/v2.1/release-notes/ReleaseNotes2.1.1CE.html.','http://devdocs.magento.com/guides/v2.1/release-notes/ReleaseNotes2.1.1CE.html ',0,0),(11,4,'2016-09-21 21:52:35','We Need Your Input! Take a Survey on CMS, Tax and Other Feature Needs','The Magento team is looking for your feedback to inform our product roadmap. We’re interested in which features you use, how we can improve built-in CMS and tax features, and what new capabilities are most important to you. Your responses will be kept confidential. Please complete the survey by September 28, 2016. Get started at https://www.research.net/r/L6TB52P\n\n','https://www.research.net/r/L6TB52P',0,0),(12,1,'2016-10-12 20:27:35','Community Edition 2.0.10 and 2.1.2 Resolve Critical Security Issues – 10/12/2016','Magento Community Edition 2.0.10 and 2.1.2 resolve multiple security issues, including critical vulnerabilities with certain payment methods and Zend Framework libraries. The releases also make several functional improvements and API enhancements. Learn more about the security issues in the Magento Security Center at https://magento.com/security/patches/magento-2010-and-212-security-update and functional updates at http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html.','https://magento.com/security/patches/magento-2010-and-212-security-update',0,0),(13,1,'2016-10-25 16:53:36','Dirty COW Linux OS Vulnerability – 10/25/2016','Dirty COW (CVE-2016-5195) is a serious vulnerability affecting most Linux Operating Systems that can be exploited to gain root access to the server. More information on how to immediately update your Linux OS is available in the Magento Security Center at https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability. ','https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability',0,0),(14,4,'2016-12-14 18:39:37','New Magento 2 Releases Feature Payment, Performance & Quality Enhancements – 12/14/2016','Community Editions 2.1.3 and 2.0.11 feature new payment functionality, accelerated performance, and enhanced product quality. Learn more in the release notes at http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html ','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),(15,1,'2017-01-14 02:33:07','New Zend Framework Security Vulnerability – 1/13/2017','We’ve found a new vulnerability in a Zend Framework 1 and 2 email component used by all Magento 1 and Magento 2 software (as well as other PHP solutions). This vulnerability is serious and can lead to a remote code execution attack if your servers use Sendmail as a mail transport agent. Learn how to protect your sites at https://magento.com/security/news/new-zend-framework-1-security-vulnerability\n\n','https://magento.com/security/news/new-zend-framework-1-security-vulnerability',0,0),(16,4,'2017-01-19 16:59:15','New Magento DevBox Beta Speeds Magento 2 Setup – 1/19/2017','Magento DevBox Beta makes it faster and easier than ever to setup your Magento 2 development environment. Read our blog post to find out more at: https://magento.com/blog/technical/set-your-magento-2-development-environment-faster.','https://magento.com/blog/technical/set-your-magento-2-development-environment-faster',0,0),(17,1,'2017-02-07 20:02:30','Community Editions 2.1.4 and 2.0.12 Resolve Zend Framework Security Issue & Enhance Product Quality – 2/7/2017','Community Editions 2.1.4 and 2.0.12 address the recent Zend Framework 1 security vulnerability and improve catalog, payments, and sales modules. Review the release notes for more information:  http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),(18,4,'2017-02-17 21:09:01','Inspirational athlete, Serena Williams, will join Magento at Imagine 2017.','Imagine 2017 will bring together 3000+ international commerce experts to exchange ideas on the future of commerce. Don’t miss this opportunity to hear from inspirational athlete, Serena Williams, and Stella & Dot CEO, Jessica Herrin. Join us in Las Vegas, April 3-5. Register now at https://imagine.magento.com/\n','https://imagine.magento.com/',0,0),(19,4,'2017-02-21 17:06:57','Community Editions 2.1.5 and 2.0.13 Update Magento Copyright – 2/21/2017','Community Editions 2.1.5 and 2.0.13 contain 2017 copyright updates. That’s it. Nothing else. Isolating these changes in a single release is intended to simplify future updates and developer workflow. For more information, please review the release notes:   http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html.','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),(20,4,'2017-04-11 16:46:39','Community Edition 2.1.6 Accelerates Performance – 4/11/2017','Community Edition 2.1.6 includes several exciting performance enhancements and optimizations to category pages, layered navigation, and image resizing. Review the release notes for more information: http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),(21,1,'2017-05-31 20:01:16','Community Editions 2.1.7 and 2.0.14 Security Enhancements – 5/31/2017','Community Edition 2.1.7 and 2.0.14 include critical security enhancements, provide support for MasterCard BIN range updates, and revert image resizing changes from Enterprise 2.1.6. Review the release notes for more information: http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),(22,1,'2017-06-21 16:29:32','Magento Community Edition 2.0.15 is Now Available with an Important PayPal Update. Upgrade by June 30, 2017 to Avoid Service Disruptions – 6/21/2017','As of June 30, 2017, PayPal Instant Payment Notifications will no longer allow you to use HTTP to post messages back to PayPal for verification. To avoid service disruptions, all merchants using PayPal and Magento 2.0.x must upgrade to Community Edition 2.0.15 by June 30, 2017. All Magento 2.1.x versions already support this change, so no update is required. The new version is available from  the Community Edition Download Page (https://magento.com/tech-resources/download) and more information is available from PayPal at https://www.paypal-knowledge.com/infocenter/index?page=content&widgetview=true&id=FAQ1916&viewlocale=en_US','https://magento.com/tech-resources/download ',0,0),(23,4,'2017-08-09 17:30:50','Upgrade to Magento Open Source 2.1.8 for Over 90 Enhancements – 8/8/2017','Magento Open Source (formerly Community Edition) 2.1.8 features over 90 improvements, including cache tuning for better performance, mass action performance optimizations, and faster deployments for multi-language sites. \n\nReview the release notes for more information: http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),(24,4,'2017-08-18 14:41:03','Join the Magento BI Essentials Webinar: Make Data Easy ','Join our webinar on Tuesday, August 22nd and learn about why merchants like you are choosing Magento BI  Essentials to make it easier to harness the power of your data. \n\nBob Moore, Head of Magento BI, will be discussing the value of the reporting and dashboards that comes out-of-the-box with Essentials and the insights you can gain from them. \n\nRegister today. \n\nhttps://magento.com/resources/magento-bi-essentials-making-data-easy?lsdet=MBI-Webinar-RSS\n','https://magento.com/resources/magento-bi-essentials-making-data-easy?lsdet=MBI-Webinar-RSS',0,0),(25,2,'2017-09-11 22:52:15','USPS Name Change Impacts “First-Class Mail Parcel” Service – 09/11/2017','USPS changed their “First-Class Mail Parcel” Service to “First-Class Package Service – Retail.” Merchants offering this service must change the name, as “First-Class Mail Parcel” will no longer work. Magento is working on a code update to support this change. In the meantime, information about a workaround is available at http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html','http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html ',0,0),(26,1,'2017-09-14 23:12:36','Important Magento Open Source 2.1.9 and 2.0.16 Security Enhancements – 9/14/2017','Magento Open Source 2.1.9 and 2.0.16 include critical security enhancements and address the September 1 changes to USPS shipping. Please update your site as soon as possible. More information is available in the release notes: \n http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html.\n','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0);
