INSERT INTO `cms_page` VALUES (1,'404 Not Found','2columns-right','Page keywords','Page description','no-route','Whoops, our bad...','<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li></ul></dd></dl>\r\n','2016-05-02 20:35:50','2016-05-02 20:35:50',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(2,'Sanchez Becchi','1column',NULL,NULL,'home',NULL,'<p class=\"wb-stl-normal\" style=\"text-align: center;\">&nbsp;</p>\r\n<p class=\"wb-stl-normal\" style=\"text-align: center;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small;\"><br /></span></p>','2016-05-02 20:35:50','2017-08-18 21:17:20',1,0,NULL,'2','1column',NULL,NULL,NULL),(3,'Enable Cookies','1column',NULL,NULL,'enable-cookies','What are Cookies?','<div class=\"enable-cookies cms-content\">\r\n<p>\"Cookies\" are little pieces of data we send when you visit our store. Cookies help us get to know you better and personalize your experience. Plus they help protect you and other shoppers from fraud.</p>\r\n<p style=\"margin-bottom: 20px;\">Set your browser to accept cookies so you can buy items, save items, and receive customized recommendations. Here’s how:</p>\r\n<ul>\r\n<li><a href=\"https://support.google.com/accounts/answer/61416?hl=en\" target=\"_blank\">Google Chrome</a></li>\r\n<li><a href=\"http://windows.microsoft.com/en-us/internet-explorer/delete-manage-cookies\" target=\"_blank\">Internet Explorer</a></li>\r\n<li><a href=\"http://support.apple.com/kb/PH19214\" target=\"_blank\">Safari</a></li>\r\n<li><a href=\"https://support.mozilla.org/en-US/kb/enable-and-disable-cookies-website-preferences\" target=\"_blank\">Mozilla/Firefox</a></li>\r\n</ul>\r\n</div>','2016-05-02 20:35:50','2016-05-02 20:35:50',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(4,'Privacy and Cookie Policy','1column',NULL,NULL,'privacy-policy-cookie-restriction-mode','Privacy and Cookie Policy','<div class=\"privacy-policy cms-content\">\n    <div class=\"message info\">\n        <span>\n            Please replace this text with you Privacy Policy.\n            Please add any additional cookies your website uses below (e.g. Google Analytics).\n        </span>\n    </div>\n    <p>\n        This privacy policy sets out how this website (hereafter \"the Store\") uses and protects any information that\n        you give the Store while using this website. The Store is committed to ensuring that your privacy is protected.\n        Should we ask you to provide certain information by which you can be identified when using this website, then\n        you can be assured that it will only be used in accordance with this privacy statement. The Store may change\n        this policy from time to time by updating this page. You should check this page from time to time to ensure\n        that you are happy with any changes.\n    </p>\n    <h2>What we collect</h2>\n    <p>We may collect the following information:</p>\n    <ul>\n        <li>name</li>\n        <li>contact information including email address</li>\n        <li>demographic information such as postcode, preferences and interests</li>\n        <li>other information relevant to customer surveys and/or offers</li>\n    </ul>\n    <p>\n        For the exhaustive list of cookies we collect see the <a href=\"#list\">List of cookies we collect</a> section.\n    </p>\n    <h2>What we do with the information we gather</h2>\n    <p>\n        We require this information to understand your needs and provide you with a better service,\n        and in particular for the following reasons:\n    </p>\n    <ul>\n        <li>Internal record keeping.</li>\n        <li>We may use the information to improve our products and services.</li>\n        <li>\n            We may periodically send promotional emails about new products, special offers or other information which we\n            think you may find interesting using the email address which you have provided.\n        </li>\n        <li>\n            From time to time, we may also use your information to contact you for market research purposes.\n            We may contact you by email, phone, fax or mail. We may use the information to customise the website\n            according to your interests.\n        </li>\n    </ul>\n    <h2>Security</h2>\n    <p>\n        We are committed to ensuring that your information is secure. In order to prevent unauthorised access or\n        disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and\n        secure the information we collect online.\n    </p>\n    <h2>How we use cookies</h2>\n    <p>\n        A cookie is a small file which asks permission to be placed on your computer\'s hard drive.\n        Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n        a particular site. Cookies allow web applications to respond to you as an individual. The web application\n        can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n        your preferences.\n    </p>\n    <p>\n        We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page\n        traffic and improve our website in order to tailor it to customer needs. We only use this information for\n        statistical analysis purposes and then the data is removed from the system.\n    </p>\n    <p>\n        Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find\n        useful and which you do not. A cookie in no way gives us access to your computer or any information about you,\n        other than the data you choose to share with us. You can choose to accept or decline cookies.\n        Most web browsers automatically accept cookies, but you can usually modify your browser setting\n        to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n    </p>\n    <h2>Links to other websites</h2>\n    <p>\n        Our website may contain links to other websites of interest. However, once you have used these links\n        to leave our site, you should note that we do not have any control over that other website.\n        Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n        visiting such sites and such sites are not governed by this privacy statement.\n        You should exercise caution and look at the privacy statement applicable to the website in question.\n    </p>\n    <h2>Controlling your personal information</h2>\n    <p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n    <ul>\n        <li>\n            whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n            that you do not want the information to be used by anybody for direct marketing purposes\n        </li>\n        <li>\n            if you have previously agreed to us using your personal information for direct marketing purposes,\n            you may change your mind at any time by letting us know using our Contact Us information\n        </li>\n    </ul>\n    <p>\n        We will not sell, distribute or lease your personal information to third parties unless we have your permission\n        or are required by law to do so. We may use your personal information to send you promotional information\n        about third parties which we think you may find interesting if you tell us that you wish this to happen.\n    </p>\n    <p>\n        You may request details of personal information which we hold about you under the Data Protection Act 1998.\n        A small fee will be payable. If you would like a copy of the information held on you please email us this\n        request using our Contact Us information.\n    </p>\n    <p>\n        If you believe that any information we are holding on you is incorrect or incomplete,\n        please write to or email us as soon as possible, at the above address.\n        We will promptly correct any information found to be incorrect.\n    </p>\n    <h2><a name=\"list\"></a>List of cookies we collect</h2>\n    <p>The table below lists the cookies we collect and what information they store.</p>\n    <table class=\"data-table\">\n        <thead>\n            <tr>\n                <th>COOKIE name</th>\n                <th>COOKIE Description</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <th>CART</th>\n                <td>The association with your shopping cart.</td>\n            </tr>\n            <tr>\n                <th>CATEGORY_INFO</th>\n                <td>Stores the category info on the page, that allows to display pages more quickly.</td>\n            </tr>\n            <tr>\n                <th>COMPARE</th>\n                <td>The items that you have in the Compare Products list.</td>\n            </tr>\n            <tr>\n                <th>CUSTOMER</th>\n                <td>An encrypted version of your customer id with the store.</td>\n            </tr>\n            <tr>\n                <th>CUSTOMER_AUTH</th>\n                <td>An indicator if you are currently logged into the store.</td>\n            </tr>\n            <tr>\n                <th>CUSTOMER_INFO</th>\n                <td>An encrypted version of the customer group you belong to.</td>\n            </tr>\n            <tr>\n                <th>CUSTOMER_SEGMENT_IDS</th>\n                <td>Stores the Customer Segment ID</td>\n            </tr>\n            <tr>\n                <th>EXTERNAL_NO_CACHE</th>\n                <td>A flag, which indicates whether caching is disabled or not.</td>\n            </tr>\n            <tr>\n                <th>FORM_KEY</th>\n                <td>Stores form key used by page cache functionality.</td>\n            </tr>\n            <tr>\n                <th>FRONTEND</th>\n                <td>Your session ID on the server.</td>\n            </tr>\n            <tr>\n                <th>GUEST-VIEW</th>\n                <td>Allows guests to edit their orders.</td>\n            </tr>\n            <tr>\n                <th>LAST_CATEGORY</th>\n                <td>The last category you visited.</td>\n            </tr>\n            <tr>\n                <th>LAST_PRODUCT</th>\n                <td>The most recent product you have viewed.</td>\n            </tr>\n            <tr>\n                <th>NEWMESSAGE</th>\n                <td>Indicates whether a new message has been received.</td>\n            </tr>\n            <tr>\n                <th>NO_CACHE</th>\n                <td>Indicates whether it is allowed to use cache.</td>\n            </tr>\n            <tr>\n                <th>PERSISTENT_SHOPPING_CART</th>\n                <td>A link to information about your cart and viewing history if you have asked the site.</td>\n            </tr>\n            <tr>\n                <th>RECENTLYCOMPARED</th>\n                <td>The items that you have recently compared.</td>\n            </tr>\n            <tr>\n                <th>STF</th>\n                <td>Information on products you have emailed to friends.</td>\n            </tr>\n            <tr>\n                <th>STORE</th>\n                <td>The store view or language you have selected.</td>\n            </tr>\n            <tr>\n                <th>USER_ALLOWED_SAVE_COOKIE</th>\n                <td>Indicates whether a customer allowed to use cookies.</td>\n            </tr>\n            <tr>\n                <th>VIEWED_PRODUCT_IDS</th>\n                <td>The products that you have recently viewed.</td>\n            </tr>\n            <tr>\n                <th>WISHLIST</th>\n                <td>An encrypted list of products added to your Wish List.</td>\n            </tr>\n            <tr>\n                <th>WISHLIST_CNT</th>\n                <td>The number of items in your Wish List.</td>\n            </tr>\n        </tbody>\n    </table>\n</div>','2016-05-02 20:35:50','2016-05-02 20:35:50',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(5,'M.I.C.E.','empty',NULL,NULL,'mice',NULL,'<h1 class=\"p1\" style=\"text-align: center;\"><span class=\"s1\"><br /></span></h1>\r\n<h1 class=\"p1\" style=\"text-align: center;\"><span class=\"s1\">M.I.C.E - Meetings Incentive Congress and Exhibitions</span></h1>\r\n<h2 class=\"p1\" style=\"text-align: center;\"><span class=\"s1\"><br />NEW POSSIBILITIES FOR YOUR BUSINESS</span></h2>\r\n<h3 class=\"p1\" style=\"text-align: center;\"><span class=\"s1\">ABOUT US</span></h3>\r\n<p class=\"p1\" style=\"text-align: center;\"><span class=\"s1\">SANCHEZ BECCHI&nbsp; is a strategic group service providing companies with high international quality standards.</span></p>\r\n<p class=\"p1\" style=\"text-align: center;\"><span class=\"s1\">Our structure and operating principles ensure that our division are both autonomous and responsive. This allows us to be extremely close to our customers, to ensure that rapid, effective and appropriate decisions can be made. This approach also sustains the motivation of our&nbsp; employees, encouraging them to show true entrepreneurial spirit.</span>&nbsp;</p>\r\n<p class=\"p1\" style=\"text-align: center;\"><span class=\"s1\">Our manufacture and m.i.c.e teams continuously raise the bar for excellence in our products even as they honor their roots by safeguarding time-honored traditions. The law firm is young division with strong potential.</span>&nbsp;</p>\r\n<p class=\"p1\" style=\"text-align: center;\"><span class=\"s1\">In this sphere of our business, we bring together people who share a passion for lifestyle, culture and the arts.</span></p>\r\n<p class=\"p1\" style=\"text-align: center;\"><span class=\"s1\"><br /></span></p>\r\n<div id=\"wb_element_instance22\" class=\"wb_element\">\r\n<h1 class=\"wb-stl-heading1\"><span><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"{{media url=\"wysiwyg/mice.jpg\"}}\" alt=\"\" width=\"1000\" height=\"666\" /></span></h1>\r\n<p class=\"wb-stl-heading1\" style=\"text-align: center;\">Devotes himself to the development of conference &amp; exhibitions, large meetings and incentive travels.</p>\r\n<p class=\"wb-stl-heading1\" style=\"text-align: center;\">According to the different types of customers the company designs a variety of products for international conference, music &amp; sport exchange and other special programs.</p>\r\n<p class=\"wb-stl-heading1\" style=\"text-align: center;\">The company has received many groups, VIP delegations, CEO of &nbsp;enterprises with success.</p>\r\n<p class=\"wb-stl-heading1\" style=\"text-align: center;\">We are at your service at any time.&nbsp;The business scope includes outbound tours, inbound tours domestic tours, education tours&nbsp;and business tours. It can also offer services for large events, exhibitions, culture exchange programs, enterprise planning, training, graphic design culture exchange programs, enterprise planning, training, graphic designing, photographing and interpretation.<br /><br /><br /></p>\r\n<h2 class=\"wb-stl-heading1\" style=\"text-align: center;\">THESE EVENTS HELP TO CONNECT YOUR BUSINESS TO THE WORLD.</h2>\r\n<h1 class=\"wb-stl-heading1\" style=\"text-align: center;\"><a title=\"Congress\" href=\"https://www.youtube.com/watch?v=M2mxc-S17Q4\" target=\"_blank\">Congress</a>&nbsp;| <a title=\"Expo\" href=\"https://www.youtube.com/watch?v=YzIDcp9MUIk\" target=\"_blank\">Expo</a>&nbsp;</h1>\r\n</div>','2016-08-08 19:48:57','2017-04-07 22:27:35',1,0,NULL,'1','empty',NULL,NULL,NULL),(6,'Law Firm','empty',NULL,NULL,'lawfirm','Law Firm','<p class=\"wb-stl-normal\"><strong><span>The Law Firm has significant experience working on behalf of businesses suing for breach of contract, patent infringement, employment disputes, antitrust, fraud, and other causes of action.</span></strong></p>\r\n<p class=\"wb-stl-normal\"><strong><span>Our Commercial Litigation Practice Group helps businesses in legal actions against larger competitors who use unfair and illegal business practices to gain a competitive edge. Our aggressive approach to business litigation has resulted in several noteworthy &ndash; and often highly confidential &ndash; recoveries for our clients.</span></strong></p>\r\n<p class=\"wb-stl-normal\"><strong><span>Not only do our business clients benefit from our courtroom expertise, but many of our opponents have gone on to hire us to represent them in their own disputes. Clearly, they know that it\'s better to have The&nbsp;Law Firm with them than against them.</span></strong></p>\r\n<p class=\"wb-stl-normal\">&nbsp;</p>\r\n<p class=\"wb-stl-normal\"><strong><span>We dedicate ourselves to these values:</span></strong></p>\r\n<p class=\"wb-stl-normal\"><strong><span>Integrity&nbsp;because acting with integrity is vital to building and maintaining trust and good relationships.</span></strong></p>\r\n<p class=\"wb-stl-normal\"><strong><span>Respect&nbsp;because what we do has an impact on many people&rsquo;s lives.</span></strong></p>\r\n<p class=\"wb-stl-normal\"><strong><span>Courage&nbsp;because ethical questions are rarely easy but must be addressed.</span></strong></p>\r\n<p class=\"wb-stl-normal\"><strong><span>Transparency&nbsp;because we must always be truthful, sincere and be able to justify our actions and decisions.</span></strong></p>','2016-08-08 19:51:46','2017-04-07 22:28:20',1,0,NULL,'1','empty',NULL,NULL,NULL),(7,'Design','empty',NULL,NULL,'design','Design','<h1>Design Products</h1>','2016-08-08 20:51:57','2017-04-07 22:28:58',1,0,NULL,'1','empty',NULL,NULL,NULL);
